// Credit: https://craftpix.net/freebies/free-game-icons-of-fantasy-knight-armor-pack-11/
import SteelHelmImg from './steel-helm.png';

const SteelHelm = {
    name: 'Steel Helm',
    type: 'armor::helmet',
    effect: {
        defence: 10,
    },
    image: SteelHelmImg,
    value: 150,
};

export default SteelHelm;
